INSERT INTO `t_comment` VALUES ('1', '', '环境很好，菜品味道也不错，而且很实惠。幽幽的音乐很温馨。一般同事聚会我很经常去。', '1', '5', '1', '0', '0', '0', '0', '1158', '41', '1378702552', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('2', '', '去吃过好几次，环境安静，闹钟取静，很干净，价位很公道，口味不错，有包厢，也适合朋友、家庭集会，晚上人较多。唯一的不足是位子不是很多，去得晚可能要等位子。', '1', '4', '1', '0', '0', '0', '0', '634', '42', '1378713359', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('3', '', '味道棒，每年都会去好几次，如果价格再便宜点，估计月月都要去啦   过生日基本必去那里过的！上次看到老人办百寿宴，新婚办婚宴的，都很棒哈  每次都吃的很HIGH，吃好几轮，每种少吃点因为品种实在是太多了  应有尽有 能想到的都有  还有书架可以小憩 实在吃撑了最后去茶水吧泡个山楂茶开胃  中间会休息下，再去吃 嘿嘿  总之在南京除了天帝素食是点菜的，就认这家啦 几百种自助，过瘾~ 满足', '1', '5', '1', '0', '0', '0', '0', '419', '65', '1378950758', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('4', '', '素鱼特别好吃，每次必点 素面便宜，10元左右一大碗，节日佛诞还免费施素面！赞！环境非常棒！家具装饰都考究！门口有免费停车位。感觉菜味道特别好，而且价格好，性价比特别高。个人认为是南京最好的一家点菜素餐厅，自助的就是绿野了  如果不是因为比较远，肯定会经常去的 期待多开分店哈', '1', '5', '1', '0', '0', '0', '0', '416', '65', '1378951067', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('5', '', '我去的时候他们正在装修，没有营业，据说要装修到2013年12月。从外观看，营业面积不小，分上下两层，闹中取静。发这个消息还要打分，不打分不让发表，口味、服务等项目只能临时选择4星。花费不填也不让发表，就只能写来回的地铁费用4元。这个点评还有缺陷，需要改进。', '1', '4', '1', '0', '0', '0', '0', '1103', '14', '1380239077', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('6', '', '还不错吧，挺实惠的素食餐厅！', '1', '5', '1', '0', '0', '0', '0', '1175', '1', '1393643488', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('7', '', '很不错的餐厅，下次还想去', '1', '4', '1', '0', '0', '0', '0', '1189', '1', '1425396881', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('8', '', '经常去. 很好,值得推荐!', '1', '4', '1', '0', '0', '0', '0', '293', '14', '1427161310', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('9', '', '闹中去静, 去武大看樱化吃饭的好地方!! 特别推荐!!', '1', '5', '1', '0', '0', '0', '0', '634', '14', '1427162110', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('20', '', '记得第一家绿米大概创建于2013年，超市、餐厅、服饰、咖啡吧、书房一起都承包了，而且绿米店内的每一件物品都来自二手改造，而且据说是他们老板专门挑选和摆设的，不仅装修用心，做菜也不含糊，所有菜都是有机的，有自助餐、下午茶，油不用转基因的。菜品既有西式又有中式，自助餐以中式为主。', '1', '4', '1', '0', '0', '0', '0', '1627', '14', '1452355320', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('18', '', '总体还可以，采的口味也不差，东西属于够吃，去晚了，菜就不加了，这在哪个自助餐厅都是差不多的。水果挺新鲜，早点去吃口感较好。', '1', '4', '1', '0', '0', '0', '0', '1652', '14', '1451896497', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('19', '', '菜的品种不少，有的菜口味和天津其它素菜馆的有相当区别，不是太油太腻，但是入味。比如煎豆腐，吃口粉嫩但不似嫩豆腐那么软易碎易烂，也不像老豆腐那样偏粗，滑嫩而不烂，还有一定的焦香味。', '1', '4', '1', '0', '0', '0', '0', '1664', '856', '1452312083', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('16', '', '自助餐品种不少，还有点菜，特喜欢炸鸡块，里嫩外酥，蘸着番茄酱，胃口大开。', '1', '4', '1', '0', '0', '0', '0', '1636', '14', '1451556711', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('17', '', '中等大小的店面，看得出尽心精致的设计，只可惜包房不多；每次点餐的菜都有一定回味，是用心做的缘故吧，每隔一段时间后又可以发现一些新菜可以品尝，还可以在老菜中不经意发现原来不注意的菜竟然也是不错的，居然过去没有去品尝。中午有性价比不错的套餐供应。', '1', '5', '1', '0', '0', '0', '0', '370', '14', '1451572676', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('15', '', '有2层,相对较安静,次地区吃素的好去处,推荐!', '1', '4', '0', '0', '0', '0', '0', '318', '655', '1431621807', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('13', '', '吃过一次,环境不错. 口味也不错! 推荐!', '1', '4', '0', '0', '0', '0', '0', '318', '14', '1427696628', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('14', '', '价格实惠，面条下得不粘牙有弹性，浇头可以单买，一碗面可以加不同的浇头，还可以5元加两块素鸡。大馄饨鲜美馅足，吃了不过瘾，还买了生馄饨，回去自己下，另外买了浇头。店楼下墙面上帖着不少客户评价的即时贴，想不到小小的面店居然获得这么多的赞！还有新民晚报上刊登的介绍这家小店的文章。老板姓顾，聊天中了解到他为了环保和健康坚持推动素食，艰辛创业，无怨无悔，令人敬佩。', '1', '4', '1', '0', '0', '0', '0', '1197', '14', '1427733187', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('21', '', '非常好吃哦，离第一八佰伴不远，交通方便，价格也很便宜，以后可以经常来。', '1', '5', '1', '0', '0', '0', '0', '1663', '872', '1452774239', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('22', '', '每周三和初一、十五有优惠，15元/位，比团购还便宜。目前有团购，到2016年2月29日结束价格688元，8-10人商务素食套餐内容包含：\r\n凉菜：\r\n蜜汁红枣、凉拌三丝、紫气东来、四喜烤麸、苔菜腰果、美味酱萝卜、家乡炒菜、凉拌黑木耳各一份；\r\n热菜：\r\n美味香芹羹、糖醋莲藕、铁板豆腐、素炒三丁、杭式炸响铃、干煸四季豆、丝瓜炒羊尾笋、杏鲍菇炒西兰花、山药炒黑木耳、清炒荷兰豆、野山菌汤、美味双点各一份\r\n饮品：\r\n鲜榨果汁、现磨豆浆无限量畅饮，水果拼盘 1份', '1', '4', '1', '0', '0', '0', '0', '1443', '14', '1454776747', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('23', '', '借用有人的评论：素食轻奢餐，环境好，菜品排盘有禅意。', '1', '4', '1', '1', '0', '0', '0', '1597', '14', '1456561268', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('24', '', '自助餐18元一位，小火锅30元一位，环境不错，口味虽比不上点餐，在自助餐餐厅中还是可以的。', '1', '3', '1', '0', '0', '0', '0', '1597', '14', '1456561689', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('25', '', '价格很便宜哦，东西很干净，不用味精', '1', '4', '1', '0', '0', '0', '0', '1586', '942', '1458583776', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('26', '', '不错的地方，实惠味道也好，人少安静……，就是没有停车位，据老板娘说2016年春节后要重新考虑投资建新餐厅。', '1', '4', '1', '0', '0', '0', '0', '1588', '14', '1460634428', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('27', '', '秘制料碟很好吃，锅底比较清淡，料台各种蘸料很齐全，适合各种口味，尤其是小米辣，很对俺的重口味。喜欢店内禅味，服务很周到。喜欢！', '1', '5', '1', '0', '0', '0', '0', '1987', '967', '1461211491', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('28', '', '和好友家庭聚会，锅底口味清淡，适合父母和娃娃。店内环境安逸，室外还有露台，可以喝免费的下午茶。服务轻声细语，很周到。惜福卡很有特色，提醒大家要光盘，很好。价位也适中，偶尔吃素养养生挺好的。', '1', '5', '1', '0', '0', '0', '0', '1986', '967', '1461211809', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('29', '', '是他们家的老会员了，几乎每家店都去捧场。这家店貌似刚开张不久，折扣力度很大，划得着。青稞扎萨、非洲冰草几乎每次必点，蘸料是大爱，喜欢他家的料台，可以随心调配自己喜欢的口味。虽然锅底清淡，但配上蘸碟，每次都吃得很满足。', '1', '5', '1', '0', '0', '0', '0', '1983', '967', '1461212073', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('30', '', '环境一流,很有禅意,', '1', '5', '1', '0', '0', '0', '0', '1988', '973', '1461212209', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('31', '', '服务很用心\\\\周到\\\\很欢喜', '1', '5', '1', '0', '0', '0', '0', '1987', '973', '1461212414', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('32', '', '一家三口去的，小朋友轻车熟路地点了青稞扎萨，这个是她的最爱，还不忘嘱咐服务叶子姐姐不要放辣椒和香菜。服务叶子很亲切周到，喜欢他家一如既往的温馨风格，会尽量满足客人的要求，温馨提示我们光盘惜福，尽量把点的菜吃完。本来在家里很难做到的小朋友也很配合，喜欢他们家的传统文化氛围。', '1', '5', '1', '0', '0', '0', '0', '1981', '967', '1461212447', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('33', '', '带老人孩子两家聚会，看到门口等位的很多，很庆幸提前订了座。老人们口味清淡，很喜欢他家的藏茶锅底，说吃起来肠胃没负担。成都大都是麻辣口味，难得看到父母吃得这么开心。小朋友喜欢他们家的秘制酱料，好吃又不辣。服务的姐姐笑得很甜，服务贴心。豆茶据说是粗粮和藏茶一起磨的，口感像豆浆，但比豆浆细腻浓郁。', '1', '5', '1', '0', '0', '0', '0', '1984', '967', '1461213446', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('34', '', '味道巴适，清淡但又有重口味的选择，健康而又环保，暖心的服务正是其特有的价值！让你心静而平和！', '1', '5', '1', '0', '0', '0', '0', '1982', '973', '1461213805', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('35', '', '菜的卖相不错，搭配颜色吸引人，就是口味略淡，感觉有点不入味。装修很好。服务也不错。喜欢他们家的包子和凉拌木耳，比较入味。', '1', '4', '1', '0', '0', '0', '0', '984', '14', '1473007884', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('36', '', '中午人很多，需要排队，店比较小巧，上下两层，可供30人同时用餐。面条既有7元的葱油面，也有不少40多元的面条。还有盖浇饭。有外卖盖浇饭，面条担心糊，所以还没有外卖。店里食品不是纯素，有卖鸡蛋，用的蚝油是荤蚝油，据老板说会在16年国庆后使用素蚝油。吃纯素的人要问问清楚。', '1', '3', '1', '0', '0', '0', '0', '2322', '14', '1475567780', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('37', '', '喜欢他家的原磨豆浆，面条和粥也不错。', '1', '4', '1', '0', '0', '0', '0', '2396', '14', '1475680846', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('38', '', '菜色挺多的，因为价格便宜人也超多，其中中老年人去的会比较多，这个价很值。一楼应该是厨房，二楼有个佛堂，三楼是吃饭的地方。', '1', '4', '1', '0', '0', '0', '0', '2492', '14', '1477112444', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('39', '', '他家的素菜还是不错的，喜欢他家的素豆腐好吃，还有野菜做的也不错，东西还是很棒大的。他家的价格不贵，这是一家老店，而且还有很多糕点。', '1', '5', '1', '0', '0', '0', '0', '2333', '1121', '1483924170', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('40', '', '素鸡素鸭做得蛮好吃的~买给奶奶 她很喜欢~就是那种老上海的味道~', '1', '5', '1', '0', '0', '0', '0', '2333', '1121', '1483926813', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('41', '', '父女两分别开了两家素菜馆，这家比较偏本帮，另外一家西式一点。口味不错，百叶结红烧肉很有肉的感觉，什锦锅仔内容丰富。鲜肉菜饭和馄饨也做得非常好吃。很平民的一家素食馆', '1', '5', '1', '0', '0', '0', '0', '2313', '1121', '1484102368', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('42', '', '素芥末乳酪球 芥末乳酪球 素牛肉贡丸 黄金饼 养生 高汤素面 养生锅 笑脸土豆饼 海鲜豆腐 番茄 春卷', '1', '5', '1', '0', '0', '0', '0', '2302', '1121', '1484221737', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('43', '', '汤底选了鲜番茄汤+巫菇菇汤，巫菇菇汤是用来烧菌菇汤的，味道还可以。鲜番茄汤是用番茄和土豆一起烧的，番茄味道很浓，而且需要加汤的时候加的也是鲜番茄汤，这个很不错，不会冲淡汤底的味道，始终保持汤底的浓郁口感。', '1', '5', '1', '0', '0', '0', '0', '2280', '1121', '1484274004', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('44', '', '太超值了，每个工作人员都很和气，环境很好，没有浪费现象，下次约人去', '1', '5', '1', '0', '0', '0', '0', '2165', '1121', '1484391805', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('45', '', '有机素食，口味很高级。就餐环境特别棒，安静又清新。适合聊天，减肥～服务员服务特别好。以后有机会会再来。最后上的桃胶糖水很好喝，忘记拍了。', '1', '5', '1', '0', '0', '0', '0', '1678', '1121', '1484393726', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('46', '', '汉堡 , 蛋糕 , 南瓜汤 , 巧克力蛋糕 , 下午茶 , 蓝莓蛋糕 , 玄米茶 , Salad , 糙米饭 , 紫薯汤 , 南瓜色拉 , 有机茶 , 无花果蛋糕 , 巧克力豆腐 , 色拉拼盘 , 巧克力豆腐蛋糕 , 牛油果糙米饭 , 糙米饭团 , 牛油果红菜头盖饭 , 糙米饭团盘 , 巧克力豆奶蛋糕 , 发酵茶 , Herb', '1', '5', '1', '0', '0', '0', '0', '362', '1121', '1484739641', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('47', '', '优吉健康素食馆，一家环境挺优雅的地方，窗明几净的感觉，坐在里面吃饭的感觉很舒服，对于吃饭的地方的环境还是很在乎的，环境好的食欲都会好一点的，环境太差的话多一刻都不想呆，健康素食，吃着感觉还不错，味道也蛮好的，对于素食的感觉一直是很好奇的，应该是很好吃的味道，感觉也挺健康的，做出来的菜都是汤浓味美的感觉，虽然价格相对而言要贵一点，但是也还可以接受，这个价位能吃到这样的菜，还是物超所值的，只来过一次但印象还是蛮深的，因为味道令人难以忘怀', '1', '5', '1', '0', '0', '0', '0', '380', '1121', '1484741271', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('48', '', '味道很不错，能把简单的素菜做成不简单的味道，厨师也是棒棒哒！ 以后也会去吃得，店家做的菜都是有一定量的，吃完就没有了，毕竟成本在那里，11块钱吃这么好的自助——这么大的优惠去那里找呀？菩提素啊～哈哈(ಡωಡ)hiahiahia', '1', '5', '1', '0', '0', '0', '0', '1184', '1121', '1484874553', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('49', '', '不错，环境可以，素食真的不错，还是绿色食品，很好值得推荐，服务也挺不错的，呵呵，终于发现素食的好地方了', '1', '5', '1', '0', '0', '0', '0', '606', '1121', '1484876014', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('50', '', '团购点评\r\n \r\n偶然发现的这个素食自助，今天带爹妈来试试果然不错', '1', '5', '1', '0', '0', '0', '0', '2487', '1121', '1484878338', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('51', '', '真正的全部素食的火锅店！地方很宽敞，环境特别好，里边不让抽烟也不让喝酒！而且里边一直放着清柔的歌曲，让人进餐时感觉很舒服！感恩吃素，吃素是慈悲，吃素是健康！甚至让人有种在佛教圣地的食堂就餐的清雅感觉！28元一位，价格还可以接受，而环境却是很清幽！', '1', '5', '1', '0', '0', '0', '0', '2484', '1121', '1484878759', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('52', '', '作为一家人均二十出头的素食自助，差点想给他五星，冷菜也有，炒各种素菜，主食有炒面，粉条，粉干，米饭，粥，玉米番薯，馒头，真的已经很全了，我觉得锅巴，韭菜鸡蛋饺子，藕和菇馅儿的生煎比较好吃，团购算下来人均21，价格可以，有人浪费严重，建议这方面控制一下', '1', '5', '1', '0', '0', '0', '0', '2483', '1121', '1484878929', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('53', '', '这里的菜是纯素的，油也是采用非转基因的，很干净，老板和服务员都很好，还可以和他们讨论佛法，非常适合喜欢吃素的善友哦', '1', '5', '1', '0', '0', '0', '0', '2002', '1121', '1484879473', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('54', '', '性价比还不错！但是如果按菜单单点的话就有点小贵了！最受欢迎的一道菜就是那个炸蘑菇！孩子们全都嚷嚷着吃呢～再有就是赶上今天是腊八，店家送了我们一锅腊八粥，粥熬的很美味，里面的料也很丰富！大赞一个！一锅粥基本都让我们喝没了…', '1', '5', '1', '0', '0', '0', '0', '2001', '1121', '1484879831', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('55', '', '這次是來吃自助的自助是六個涼菜，兩分水果，熱菜是8個菜花、蘑菇、芹菜豆干、青椒豆皮、豆腐、燉菜、乾扁四季豆、炒餅（不知道算不算菜）。主食小饅頭，烙餅，雜糧紫薯、紅薯、玉米。湯有西紅柿雞蛋湯、和南瓜大米粥。總體來說就是食堂味道沒什麼驚艷，39的價格其實只能吃個20左右，但必經是飯店所以還是挺值的！', '1', '5', '1', '0', '0', '0', '0', '1956', '1121', '1484880106', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('56', '', '素食而做，有好多菜做的和肉味一样，很好，我们11个人花了5百多，一个人合50，也不贵，并且服务很好，环境装修也不错', '1', '5', '1', '0', '0', '0', '0', '1417', '1121', '1484880930', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('57', '', '口味是我吃过的集营养、美容、减肥与一身的尚好去处。不愧是中国金奖大厨！环境让人很舒服，在繁闹的都市生活里难得遇到的轻松感觉。服务对于一家新开的店来说服务技巧一般但很真诚。', '1', '5', '1', '0', '0', '0', '0', '1416', '1121', '1484881044', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('58', '', '纳地素食餐厅是石家庄最好的一家素食餐厅，2005年开始经营，也是一家老店。餐厅信誊比较好，每天来的人比较多。该店餐饮口闻清淡，非常好，把豆制品做成肉的口感，值得称赞，既满足了想吃肉的愿望，又能养生！', '1', '5', '1', '0', '0', '0', '0', '1414', '1121', '1484881366', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('59', '', '应该是邯郸市第一家全素食餐馆吧。可以点菜，可以自助。自助不到十块钱，超便宜，挑战北京的9元爱心小厨房了。', '1', '5', '1', '0', '0', '0', '0', '171', '1121', '1484882942', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('60', '', '要了一个鱼，上来一看才知道是豆腐和海苔，外形做的很像，口味有点辣，像水煮鱼。\r\n台菇，炒的，338米，价格不菲，吃到嘴里味道不太习惯，土土的味道。\r\n那年秋天的茄子，好吃，炸的茄子，有玉米粒，甜口，有点像鱼香味。\r\n刀削面，西红柿的，好大一碗，口味偏重，很好吃。里面配菜也不少。', '1', '5', '1', '0', '0', '0', '0', '1515', '1121', '1484884751', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('61', '', '出差特意过来吃斋，满满一桌子菜，不敢相信只是豆制品做出来的，每一道都很有特点，干烧鱼，很像鱼肉的质感，鱼皮出奇的像。京酱肉丝也还不错。最喜欢的是拔丝芋头，五谷丰登是紫米腰果做的炒饭，百合穿心莲糖汁浇的太甜了，最好百合是煮熟的。圆子锅满满当当都是素丸子，可以再加点蔬菜作陪，就可以喝高汤了。整体来说，很美味，每一道小菜都很用心，名字起的也好。', '1', '5', '1', '0', '0', '0', '0', '1505', '1121', '1484911734', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('62', '', '吃的早餐 第二次吃了。很好。11点前吧，9点半以后。价格45。吃完画会儿画，晒晒太阳，舒服。', '1', '5', '1', '0', '0', '0', '0', '2263', '1121', '1484963606', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('63', '', '服务态度好 环境不错 味道不错 品种丰富 没有时间限制，我和同学 朋友经常过来，聊一下午都不会干涉，真好，愿意常来', '1', '5', '1', '0', '0', '0', '0', '2244', '1121', '1484964467', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('64', '', '偶然路过，想着减肥就吃些素菜吧。全部都是素菜，老板娘特别热情，她说南瓜是自己家里种的，可以随意去厨房参观，等到受斋日时前几名可以免费来吃。感觉不管是店家的服务还是装修，菜品，都真的是在凭良心做的。很棒', '1', '5', '1', '0', '0', '0', '0', '2595', '1121', '1485231162', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('65', '', '真的不得不给五星的一家店～～\r\n29元优惠时候买的，太便宜了好吗。以后价格上来的还会继续购的！', '1', '5', '1', '0', '0', '0', '0', '2594', '1121', '1485231530', '0', '2017-08-05 11:06:43');
INSERT INTO `t_comment` VALUES ('66', '', '亲，推荐一个苏城最优雅的素食餐厅，来一次，久久不能忘怀，留恋不舍的美味', '1', '5', '1', '0', '0', '0', '0', '2579', '1121', '1485231858', '0', '2017-08-05 11:06:43');
