INSERT INTO `t_user_profile` VALUES ('68', '', '', '三好食品公司', '', '', '', '三好食品有限公司是一家专业从事有机生态纯净素食食品的研发、生产与销售的企业。\n产品分为纯植物蛋白系列（冷冻）、生态豆制品系列、纯植物酱料系列、纯植物糕点系列、生态杂粮系列等近80多个品种。\n为了能制作出营养健康、纯净无污染的食物，我们生产所用原料不含任何化学农药、化学化肥、激素等，生产过程中不添加任何食品添加剂、防腐剂及肉、蛋、奶等动物成分。\n为了更好的发扬健康环保的素食文化，更好的引导人类走向健康的饮食，本公司现面向全国招商，欢迎社会各界有识之士加盟代理！', '2', '130000', '131000', '131082', '0', '1378989073', '2017-08-05 13:19:00');
