INSERT INTO `t_user_profile` VALUES ('797', '', '', '素喜斋', '', '', '', '由多位爱心人士发起、立志于推广健康饮食\n的全素食餐厅。我们以人们的身心健康为第一，从食材选料、\n加工切配、烹调煮制、及店堂环境布置，均融入了我们无比\n诚挚关爱之情，唯愿顾客品尝健康素味同时，亦能留存一份\n真实清心的记忆。在此，感恩我们的厨师，是他们给我们带\n来这口口的美味；感恩我们的义工，她们无偿付出给以我们\n坚实的信念和做好的勇气。最后，感恩你们的吃素，愿素食\n给你们带去最真实之利益！', '1', '310000', '310100', '310117', '0', '1443170795', '2017-08-05 13:20:25');
