INSERT INTO `t_user_profile` VALUES ('819', '', '', '清河莲海素食', '', '', '', '莲海素食以素食推广为己任。以“恭敬生命，感恩吃素”为宗旨，多吃一份素食，就少吃一份荤食，就少一份杀生。\n    餐厅承诺：无烟、无酒、无肉、无荤，无蛋、无奶\n    培养慈悲心、少食肉、多食素，多积善缘就是等于领到福报的通行证。\n    爱生活，爱健康，坚信吃素是福，就从莲海素食开始。\n    地址：清河县太行路家乐园南300米，东方雅居对过路东。\n电话：0319—8189588  手机：15530996600\n ', '1', '130000', '130500', '130534', '0', '1445744422', '2017-08-05 13:20:28');
